import i18n from 'i18next'

const WeatherApp = () =>(
    <main>  
        <div>
            <button onClick={() => changeLanguage("en", i18n)}>EN</button>
            <button onClick={() => changeLanguage("sk", i18n)}>SK</button>   
            <button onClick={() => changeLanguage("de", i18n)}>DE</button>   
        </div> 
        <div>
            {temperatureDropdownList( (units, abbreviation ) => {
                })
                }
        </div>
        <Switch>
            <Route exact path ='/' component= {WeatherCurrentComponent}/>
            <Route exact path ='/forecast' component= {WeatherForecastComponent}/>
        </Switch>
    </main>
)

